Recap of some of the best items I ate this year at the CNE



@wingkxng – Offering up some of the largest and juiciest wings. Their Garlic Parm is one of the best, but exclusive to the CNE is their PB&J
@footlongfreakkfries – Serving the longest fries in the city! Each fry is one foot long and the best flavour is Garlic Parm again!
@thekingofcurds – No visit to the CNE is complete without a visit to this staple to CNE. This year they have the Yabba Dabba Curds which come with a cereal milk glazes and covered with fruity pebbles
@dutchfrites – Check out their Dutch Fries or Indo Fries!
@eat_my_bowls – Hard to pick a favourite from this spot! The Malibu Mac and Cheese with Caviar on top is an amazing option! However our top pick is the Big Kahuna which includes rice, avocado and seared tuna, all served in a giant pineapple.


